import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Button, ButtonToolbar } from 'reactstrap';
import btwist from './btwist.MOV'
import {Helmet} from "react-helmet";


const NameHeader = (props) => {
  return (
    <div>
      <Jumbotron>
        <h1 className="display-3">Avery Wong</h1>
        <p className="lead">{"Hey guys this my personal website!"}</p>
        <hr className="my-2" />
        <p></p>
        <img width="400"  src={require('./profile.jpg')} />
        <p className="lead">
        </p>
      </Jumbotron>

    </div>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <NameHeader />
        <ButtonToolbar>
          <Button variant="workExperience">Work Experience</Button>
          <Button href="#flip-video" variant="meFlipping">Me Flipping</Button>
         </ButtonToolbar>
        <video width="1200"  id="flip-video" className='videoTag' autoPlay loop muted>
         <source src={btwist} type='video/mp4' />
       </video>
        </header>
      </div>
    );
  }
}

export default App;
